import React, { Component } from 'react';

class Skills extends Component{
    render(){
        return (
            <section className="skills-container">
                <div className="lang">
                    <ul>
                        <li>HTML5</li>
                        <li>CSS3</li>
                        <li>Javascript / ES6</li>
                        <li>PHP</li>
                        <li>MySQL</li>
                        <li>Python</li>
                    </ul>
                </div>
                <div className="tools">

                </div>
            </section>
        )
    }
}

export default Skills;
